package problemsolving;
import java.io.*;
import java.util.*;
import java.text.*;
import java.math.*;
import java.util.regex.*;

public class PalindromeIndex {

    public static void main(String[] args) {
        /* Enter your code here. Read input from STDIN. Print output to STDOUT. Your class should be named Solution. */
                Scanner scanner= new Scanner(System.in);
                int noOfTestCases=Integer.parseInt(scanner.nextLine());
                char[] str;
                int i,j,count=0;
                boolean duplicateFound=false,isOdd=true;
                while(count<noOfTestCases){                                                                        
                    duplicateFound=false;           
                     str=scanner.nextLine().toString().toCharArray();
                            i=0;j=str.length-1;
                            if(str.length%2==1)isOdd=true;
                            else    isOdd=false;
                                                        
                            while(i<j){                                        
                                  if(str[i]!=str[j]){
                                        duplicateFound=true;                                      
                                        if(str[i+1]==str[j]){
                                            if(!isOdd){   
                                                System.out.println(""+i);break;
                                            }
                                            else if(isOdd && str[i+2]==str[j-1]){
                                                System.out.println(""+(i-1));break;
                                            }
                                        }
                                        else if(str[i]==str[j-1]){
                                            if(!isOdd){   
                                                System.out.println(""+j);break;
                                            }
                                            else if(isOdd && str[i+1]==str[j-2]){
                                                System.out.println(""+(j+1));break;
                                            }
                                        }
                                  }
                                        
                                        i++;j--;
                            }
                            
                            if(!duplicateFound)
                                     System.out.println("-1");
                            
                     count++;       
                }
                
    }
    
}

